import React from 'react';

const contacts = [
  {
    name: 'NDRF (National Disaster Response Force)',
    phone: '011-12345678',
  },
  {
    name: 'Fire Department',
    phone: '101',
  },
  {
    name: 'State Disaster Management Authorities (SDMAs)',
    phone: '011-87654321',
  },
];

const EmergencyContact = () => {
  const handleCall = (phone) => {
    window.location.href = `tel:${phone}`;
  };

  const handleSMS = (phone) => {
    window.location.href = `sms:${phone}`;
  };

  return (
    <div className="p-4 bg-white rounded shadow mb-8 max-w-4xl mx-auto">
      <h2 className="text-2xl font-bold mb-4">ðŸ†˜ Emergency Contact Section</h2>
      <ul>
        {contacts.map((contact) => (
          <li key={contact.phone} className="mb-4 flex items-center justify-between border-b border-gray-300 pb-2">
            <div>
              <p className="font-semibold">{contact.name}</p>
              <p className="text-gray-600">{contact.phone}</p>
            </div>
            <div className="flex gap-4">
              <button
                onClick={() => handleCall(contact.phone)}
                className="bg-red-600 hover:bg-red-700 text-white py-1 px-3 rounded"
              >
                Call Now
              </button>
              <button
                onClick={() => handleSMS(contact.phone)}
                className="bg-yellow-500 hover:bg-yellow-600 text-white py-1 px-3 rounded"
              >
                Send SMS
              </button>
            </div>
          </li>
        ))}
      </ul>
    </div>
  );
};

export default EmergencyContact;
